try:
        network = IPv4Network(ip_range)
    except ValueError:
        raise ValueError(f"Invalid CIDR notation: {ip_range}")

    with open(csv_path, mode="w", newline="") as csvfile:
        writer = csv.writer(csvfile)
        writer.writerow(["IP"])
        for ip in network:
            writer.writerow([str(ip)])

    return csv_path

try:
        network = IPv4Network(ip_range, strict=False)
    except ValueError as e:
        raise ValueError(f"Invalid IP range: {ip_range}") from e

    with open(csv_path, 'w', newline='') as file:
        writer = csv.writer(file)
        for ip in network:
            writer.writerow([str(ip)])

    return csv_path

try:
        ip_network = IPv4Network(ip_range, strict=False)
    except ValueError as error:
        raise ValueError(f"Invalid IP range: {ip_range} ({error})")

    with open(csv_path, 'w', newline='') as csvfile:
        writer = csv.writer(csvfile)
        writer.writerow(['IP Address'])
        for ip in ip_network:
            writer.writerow([str(ip)])

    return csv_path

try:
        network = IPv4Network(ip_range)
    except ValueError as e:
        raise ValueError('Некорректный IP адрес') from e
    with open(csv_path, 'w', newline='') as file:
        writer = csv.writer(file)
        for ip in network.hosts():
            writer.writerow([str(ip)])
    return csv_path
